//image imports
import sands from "./images/sands.png"
import star from "./images/star.png"
import sia from "./images/sia.png"

const cardDict = [
	{
		id: 1,
		img: sands,
		title: "Sands Group",
		desc: "You have X points",
	},
	{
		id: 2,
		img: star,
		title: "Star Alliance",
		desc: "You have X points",
	},
	{
		id: 3,
		img: sia,
		title: "SIA",
		desc: "You have X points",
	},
];

export default cardDict;
